import React from 'react'
import Chatbar from './Chatbar'

export const Chats = () => {
  return (
    <div className='chat_container' >
        <div className='chatbar'> <Chatbar/> </div>
        <div className='chat'>chat</div>
        <div className='send'>send</div>
    </div>
  )
}
